const _hoisted_6 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Caster</li><li>True Name: Cu Chulainn</li><li>Sex: Male</li><li>Origin: Celt myth</li><li>Region: Europe</li><li>Alignment: Lawful Neutral</li><li>Height: 185cm</li><li>Weight: 70kg</li></ul><p><strong>Meta</strong></p><ul><li>Designer: Sakurai Hikaru</li><li>Character Design: Mata</li><li>Voice Actor: Nobutoshi Kanna</li><li>Appearance in Main Works: Fate/Grand Order</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">E</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">B</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Territory Creation: [B]</strong></p><p>A magus&#39; ability to create a terrain that is advantageous to themselves.</p><p>He can create a territory adapting his master&#39;s Noble Phantasm, which is a &#39;gate&#39;. However this seems to be something he keeps secret, since were he to use it, his master would come to attack him shouting &quot;you&#39;re a rip-off, you fool!&quot;.</p><p><strong>Divinity: [B]</strong></p><p>Due to being the son of the sun god Lugh, Cu Chulainn possesses high divinity.</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Rune Magecraft: [A]</strong></p><p>The possession of the norse rune magecraft he received from Scathach.</p><p>Due to being summoned as a Caster, his rank in this skill is higher than as a Lancer.</p><p>He can produce powerful and varied effects by using different runes. Outside of offensive runes, he can also produce effects such as giving himself the Magic Resistance and Clairvoyance skills, as well as raising his stats to A, etc. These effects are temporary and he cannot use many of them at once.</p><p><strong>Disengage: [C]</strong></p><p>The ability to escape from battle.</p><p>He can return disadvantageous battle conditions to their initial form.</p><p><strong>Protection from Arrows: [A]</strong></p><p>A skill that protects him from projectile attacks.</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="wicker-man-cage-of-scorching-consuming-flames" tabindex="-1"><a class="header-anchor" href="#wicker-man-cage-of-scorching-consuming-flames" aria-hidden="true">#</a> Wicker Man - Cage of Scorching, Consuming Flames</h1><ul><li>Rank: B</li><li>Type: Anti-Army</li><li>Range: 1~50</li><li>Maximum Targets: 100</li></ul><p>Wicker Man. It materializes a giant made from small tree branches. The giant is covered in flames, and attacks its target with powerful fire and heat damage.</p><p>The torso of the giant functions as a cage, usually there would be sacrifice trapped inside. However, when materializing as a Noble Phantasm, the giant does not receive a sacrifice, and instead unleashes his fury against the gods while seeking one.</p><p>This isn&#39;t a secret rune technique, but rather a Noble Phantasm representative of the celt druids given to Cu Chulainn, as he&#39;s summoned as a celt magus who controls fire.</p><h1 id="ochd-deug-odin-seal-of-the-great-god" tabindex="-1"><a class="header-anchor" href="#ochd-deug-odin-seal-of-the-great-god" aria-hidden="true">#</a> Ochd Deug Odin - Seal of the Great God</h1><ul><li>Rank: A</li><li>Type: Anti-Fortress</li><li>Range: 1~80</li><li>Maximum Targets: 500</li></ul><p>Ochd Deug Odin. In modern terminology, it&#39;d be called Matrix Wodan. It is a Noble Phantasm activated by chanting its true name and using all 18 primordial runes obtained from Scathach at the same time. The power of the rune possessed by the great Odin is released temporarily and deals inmense magic damage to the enemy camp. It also removes all buff effects from enemies, and reduces all their stats by 1 rank. In case of the enemy possessing passive NPs, these are cancelled for one or two turns.</p><p>An extremely powerful ultimate attack that is not utilized in FGO.</p><p>It&#39;s possible that usage restrictions could be set up by Odin, but the details will be left unknown here.</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>Basically the same person as the Cu from Fate/Stay Night.</p><p>There isn&#39;t a big change in his personality.</p><p>Even if his abilities and equipment change, there&#39;s no mistake that this is the same person. Though Cu himself seems to find this role a bit difficult and sometimes mutters something like &#39; this doesn&#39;t feel right &#39;.</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>He doesn&#39;t really talk about his wish for the grail. If he were pressed to say it it&#39;d be something like &#39;I want my spear&#39;, but of course that&#39;s not the goal with which he&#39;s manifested.</p><p>Having been summoned as a Caster, it seems he&#39;s taken it upon himself to act as a guide. Not as a true druid, but rather just something temporary...</p><p>As long as they&#39;re together, he will continue to shine a light on his Master&#39;s path.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>&quot;Woah. So I&#39;m a Caster this time, huh...Oh it&#39;s you. Have we met before?&quot;</p><p>&quot;Well, I&#39;ll look forward to your work as a Master&quot;</p><p>&quot;The grail, huh...That thing and I have been linked for a while.&quot;</p><p>&quot;Good work. I did pretty good on my burning too, huh?&quot;</p><p>&quot;I&#39;d like to try being summoned as a Saber some time.&quot;</p><h2 id="biography" tabindex="-1"><a class="header-anchor" href="#biography" aria-hidden="true">#</a> Biography:</h2><p>A hero from Celtic, Ulster legend.</p><p>A member of the Knights of the Red Branch and the strongest warrior in Ulster. A hero who received who used the demonic spear obtained from Scathach, ruler of the Land of Shadows, to gain fame, and also used the runes given to him by his master.</p><p>Unlike his Lancer self, his Caster version manifests as a user of diverse magecraft that inflicts pain upon his enemies with them. Apparently he uses the Ansuz rune for his fire attacks.</p><h2 id="standard-weapons" tabindex="-1"><a class="header-anchor" href="#standard-weapons" aria-hidden="true">#</a> Standard Weapons</h2><p>Long-range attacks with runes. The Ansuz rune materializes in the air when he uses fire attacks.</p><p>He can also fight at close range with his weapons. In this case, he temporarily raises his STR stat to A and fights with his oak staff or sword.</p><p>He doesn&#39;t use any metal as armor.</p><h2 id="miscellaneous" tabindex="-1"><a class="header-anchor" href="#miscellaneous" aria-hidden="true">#</a> Miscellaneous</h2><p>The same person as the Cu from FSN.</p><p>Due to his different class, his appearance also changed. He can change his hairstyle. He does not use metal armor. (Hard armor isn&#39;t necessarily unallowed. Even if it&#39;s not metal, he can still use something made from ceramic or bone.)</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>While I looked up \u201Cdruids are\u2026\u201D and kept putting together this and that it became a somewhat sexy costume (chest). The original plan was white\xD7orange colors, but since they weren\u2019t C\xFA Chulainn-like I changed them to the current colors. After that the regular lines went in. It would make me happy if I was able to emphasize the aspect of him being different from when he\u2019s a Lancer. (Mata)</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-344.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-345.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-346.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-347.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-348.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-349.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-350.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-I/i-351.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 73);
